import React, { useState } from 'react'
import data from '../data/data'

const Home = () => {

const[productdata,setproductdata]=useState

  return (
    <div className='grid '>
      <div className='grid sm:grid-cols-1 md:grid-cols-2 lg:grid-cols-3 xl:grid-cols-4 gap-4'>

        {
          data.mobilePhones.map((mobile) => {
            return (
              <div className=' ' key={mobile.name} >

                <div className="mda ">
                  <h3> {
                    mobile.name
                  }</h3>

                 
                </div>
                <div className="mda">
                  <img src="/images/galaxya.jpg" alt={mobile.name} />
                </div>


                <div className="mda">
                  {mobile.price}
                </div>
                <div className="mda"></div>



              </div>

            )
          })
        }

      </div>
    </div>
  )
}

export default Home
